import React, { Component } from 'react';
class Data extends Component {
    state = {
        users: [],
    };

    componentDidMount() {
        this.fetchData();
    }

    fetchData = async () => {
            const response = await fetch("http://localhost:8080/api/users");
            const data = await response.json();
            this.setState({ users: data });

    };

    render() {

        return (
            <div>
                <table>
                    <tr>
                        <th>Mail</th>
                        <th>Password</th>
                        <th>Name</th>
                        <th>Surname</th>
                        <th>Gender</th>
                        <th>Role</th>
                        <th>Reg. Customer</th>
                        <th>About</th>
                    </tr>
                    {
                        this.state.users.map(user => (
                            <tr key={user.id}>
                                <td>{user.mail}</td>
                                <td>{user.password}</td>
                                <td>{user.name}</td>
                                <td>{user.surname}</td>
                                <td>{user.gender.gender}</td>
                                <td>{user.rolesList[0].role}</td>
                                <td>{user.regularCustomer.id}</td>
                                <td>{user.about}</td>
                            </tr>
                    ))
                    }
                </table>
            </div>
        );
    }
}

export default Data;
